	(6, '2017-09-20 13:45:57', NULL, 1, 'Juan José ', 'Toledo Aral', NULL, '["PhD student","PI"]', 'juanjo@us.es', NULL, 'Fisiología Médica y Biofísica', 'CTS-517', 'Facultad de Medicina/IBiS', 'Director de Departamento, Coordinador de Área en IBiS y miembro de la Comisión de Investigación. Trata con temas de ética científica.', NULL, NULL, NULL, NULL, NULL, NULL),
	(5, '2017-09-20 13:16:46', NULL, 1, 'Alberto', 'Pascual Bravo', NULL, '["PI"]', 'apascual-ibis@us.es', NULL, 'Instituto de Biomedicina de Sevilla (IBiS)', 'Mechanisms of neuronal maintenance', 'Hospital Universitario Virgen del Rocío/CSIC/Universidad de Sevilla', 'To learn about the responsibilities that we have as PIs regarding ethics in Science and how to establish good practices in the lab.', NULL, NULL, NULL, NULL, NULL, NULL),
	(7, '2017-09-21 10:07:04', NULL, 1, 'Yolanda María', 'Pacheco López', NULL, '["PI"]', 'ypacheco-ibi@us.es', NULL, 'Instituto de Biomedicina de Sevilla', 'Laboratorio de Inmunovirología', 'Hospital Universitario Virgen del Rocío', 'El tema me parece de gran interés', NULL, NULL, NULL, NULL, NULL, NULL),
	(8, '2017-09-21 13:58:38', NULL, 1, 'Sonia ', 'Pinela da Silva', NULL, '["Postdoc"]', 'sonia.pinela@cabimer.es', NULL, 'Genome Biology', 'Andres Aguilera', 'CABIMER', 'As a postdoc researcher, it is essential to be active and updated in the field of Research Integrity. The discussion of the major challenges and conduct in the field of scientific research nowadays are central to our work and to be able to produce significant and reliable data and publications, stimulate meaningful and positive scientific and social discussion. Theses are, in my view, imperative if we want to produce knowledge and be able to sustain research as an essential tool of progress in all fields being it environment, health, finance, socio-cultural. etc. ', NULL, NULL, NULL, NULL, NULL, NULL),
	(9, '2017-09-21 16:46:59', NULL, 1, 'LUCIA', 'ROMERO AZOGIL', NULL, '["PhD student"]', 'lrazogil@us.es', NULL, 'QUIMICA ORGANICA Y FARMACEUTICA', 'CARBOHIDRATOS Y POLIMEROS', 'FACULTAD DE FARMACIA', '', NULL, NULL, NULL, NULL, NULL, NULL),
	(10, '2017-09-21 16:54:25', NULL, 1, 'Anabell ', 'Urbina Salazar ', NULL, '["PhD student"]', 'gata-any@hotmail.com', NULL, 'Bioquímica y Biología Molecular ', 'AGR-0258', 'Facultad de Farmacia ', 'Aprender todo lo relacionado con la investigación. ', NULL, NULL, NULL, NULL, NULL, NULL),
