	(15, '2017-09-22 08:02:25', NULL, 1, 'Lourdes', 'Martinez', NULL, '["PhD student"]', 'loumarmar91@gmail.com', NULL, 'Microbiología y Parasitología', 'BIO320 (Joaquín J. Nieto Gutiérrez)', 'Facultad de Farmacia. Universidad de Sevilla', 'Este curso me dotará nuevos conocimientos para la realización de mi doctorado y competencias para el ámbito investigador.', NULL, NULL, NULL, NULL, NULL, NULL),
